import React from 'react';
import burgerlogo from '../../../src/assets/Images/burger-logo.png';
import classes from '../Logo/Logo.css';
const logo = (props) => (
    <div className={classes.Logo} style={{height: props.height}}>
        <img src={burgerlogo} alt="MyBurger" />
    </div>
);

export default logo;
